import React from 'react';
import Postitem from "./components/Postitem";
const PostList = ({posts}) => {
    return (
        <div>
            <h1 style={{textAlign:'center'}}> Text</h1>
            {posts.map((post)=>
              <Postitem  post={post} key={post.id}/>

             ) }
        </div>
    );
};

export default PostList;
